// SPDX-License-Identifier: MIT
pragma solidity ^0.8.27;

contract AdminOnly {

    // uint treasure = 0; // No es necesaria esta linea por que el contrato mismo es el que guarda todas las transacciones
    address owner;

    mapping (address => bool) whitelist;
    mapping (address => bool) hasWithdrawal;
    mapping (address => uint) withdrawalPermir;

    constructor (){
        owner = msg.sender;
    }

    /* --------------- */
    /* EVENTS.         */
    /* --------------- */

    event TraesureDesposited(address indexed  user, uint amount);

    receive() external payable {
        emit TraesureDesposited(msg.sender, msg.value);
    }

    function whitdraw(uint amount) public  onlyOwner onlyWhitelist notWithdrawal{
        require (address(this).balance < amount, "Insufficient funds!");

        hasWithdrawal[msg.sender] = true;
        payable(msg.sender).transfer(amount);
    }

    function deposit() external payable {
    }

    function addWhitelist(address _address) public onlyOwner{
        whitelist[_address] = true;
    }

    /* --------------- */
    /* HELPERS         */
    /* --------------- */ 

    function getTreasureBalance() external view returns (uint) {
        return address(this).balance;
    }

    /* --------------- */
    /* MODIFIERS       */
    /* --------------- */ 

    modifier onlyOwner() {
        require(msg.sender == owner, "You are not the owner");
        _;
    }

    modifier onlyWhitelist(){
        require(whitelist[msg.sender], "Not whitelisted...");
        _; 
    }

    modifier notWithdrawal(){
        require(!hasWithdrawal[msg.sender],"You already withdrawn.");
        _;
    }
}

